    {
        a += i;
        a *= i;
        a += i;
        a *= i;
        a += i;
        a *= i;
        a += i;
        a *= i;
        a += i;
        a *= i;
        return a;
    }

    public int  = 0;
    public int  = 1;

    [Benchmark]
    public int long_name()
    {
         += ;
         *= ;
         += ;
         *= ;
         += ;
         *= ;
         += ;
         *= ;
         += ;
         *= ;
        return ;
    }
}
